import React from "react";
import Header from "~/components/Header";
import Slide from "~/components/Slide";
import Footer from "~/components/Footer";

const Home = () => {
  const [products, setProducts] = React.useState(true);

  React.useEffect(() => {
    setTimeout(() => {
      setProducts()
    }, 5000);
  }, []);

  return (
    <div>
      <Header />
      <Slide />
      <Footer />
    </div>
  );
};

export default Home;
